import React, { Component, useState } from 'react';
import Chart from '../LineChart/index';
import CandleApp from '../CandleChart/chart';


const Display = () => {

const [style, setStyle] = useState("visible");

const changeStyle = () => {
    setStyle("invisible");
};

    return (
        <div> 
            <div className={style}
            >
                <Chart></Chart>
            </div>

            <div
            style={{ }}
            >   
                <CandleApp></CandleApp>
            </div>

            <button onClick={changeStyle}
                id="candlesticks-button">Candlestick Chart
            </button> 
            <button 
            id="line-button">Line Chart 
            </button> 
        </div> 
    );
        
}

export default Display;
